import React from "react";
import { useNavigate } from "react-router-dom";

function Home()
{   
    let navigate = useNavigate();

    const routeChange = (path) =>{
        navigate(path);
    }
    return (
        <div>
        <h1>Home</h1>
        <button onClick={routeChange("login")}>Login</button>
        <button>Signup</button>
        </div>
    );
}

export default Home;
